import React from "react";
import "antd/dist/antd.css";
import { Link, Route, Switch, BrowserRouter as Router } from "react-router-dom";

const Home = () => {
  return (
    <>
      <h1>Home</h1>
      <p>Welcome home!</p>
      {false ? (
        <Link to="/login">
          <Button>Login</Button>
        </Link>
      ) : (
        <span />
      )}
    </>
  );
};

export default Home;
